import React from 'react'


export default function ImageClassiferBuilder(props){

    return (
        <div>
            <span>First we'll start by uploading data. In the box below, drop folders containing your image classes</span>
            <br />
            <span>You'll need to organize your images into folders to make sure that the algorithm learns correctly. For instance, if you want to classify dogs vs. cats, you'll need to create two folders. One containing dog images, and another containing cat images.</span>
        </div>
    )
}
